Cheers to @white_peony_boutique for an incredible fashion show and @indyfoundation for an incredible cause
and unforgettable evening of purpose.

Hi,  umm, excuse me.... which way to the disco ball? 😅 Never did I ever think I would buy a sequin suit (I felt like barbie ready to run a 5k) but there I was late night shopping while hungry and the rest is history. 
 Actually, I saw the suit and couldn't get it out of my mind. I mentioned it to a few power supportive women and they said "DO IT!" and here we are. I knew they wouldn't just say it,  to say it.  You absolutely can just tell when someone is being authentic with you.  Know what I mean?
This is what happens when you shop at White Peony Boutique .  These girls are truly there to dress you to feel empowered and beautiful, not just for the sale.  I've honestly never experienced anything like it. 
If you haven't treated yourself to an experience there,  I really encourage you to.  Even if you leave without a purchase,  you will have had the experience of the energy there and it's like nothing you could ever imagine. 

I'm so proud of them and what they've created in the boutique.  They are changing central Minnesota and its obvious these girls are just getting started. 🥂

Sequins optional of course,  but highly recommended.

